import { StyleSheet } from "react-native"

export const styles = StyleSheet.create({
    container:{
      flex: 1,
      backgroundColor:'#131016',
      padding: 24
    },
  
    eventName: {
      color: '#FDFCFE',
      fontSize: 24,
      fontWeight: 'bold',        
      marginTop: 48
    },
  
    eventDate: {
      color: '#6b6b6b',
      fontSize: 16
    },

    input: {
      backgroundColor: '#1F1E25'
    }
  })
